import React from "react";
import "./Loader.scss";
import {ImageList} from '../../Common/Image/Main'
function Loader() {
    return (
        <div className="loader">
            {/* <img src={ImageList.loading} alt="Loading..."/> */}
            <div className="load-1"></div>
            <div className="load-1"></div>
            <div className="load-1"></div>
        </div>
    );
}

export default Loader;
